import ExpenseItem from "./components/ExpenseItem";

function App() {

  const expenses = [

    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      date: new Date(2021, 5, 12),
    },
];



  return (

    <div>
      <h2>Lets get Started</h2>
      <ExpenseItem 
      title={expenses.title[0]}
      amount={expenses.amount[0]}
      date={expenses.date[0]}
      ></ExpenseItem>

      <ExpenseItem 
      title={expenses.title[1]}
      amount={expenses.amount[1]}
      date={expenses.date[1]}
      ></ExpenseItem>

      <ExpenseItem 
      title={expenses.title[2]}
      amount={expenses.amount[2]}
      date={expenses.date[2]}
      ></ExpenseItem>
    </div>
  );
}

export default App;
